import React, { Component } from 'react';

export class Serach extends Component {
  render() {
    return (
      <div>
        <form action="" className="form">
          <input type="text" name="text" placeholder="Serach users.." />
          <input
            type="submit"
            value="serach"
            className="btn btn-dark btn-block"
          />
        </form>
      </div>
    );
  }
}

export default Serach;
